import * as React from 'react';
import { styled } from '@mui/material/styles';
import Paper from '@mui/material/Paper';
import Grid from '@mui/material/Grid';
import { BsBucketFill } from "react-icons/bs";
import { LuMilk } from "react-icons/lu";
import { GiCow } from "react-icons/gi";
import Graphfarmer from "./page-com/graphfarmer";
import './Home.css';
const Item = styled(Paper)(({ theme }) => ({
  backgroundColor: theme.palette.mode === 'dark' ? '#1A2027' : '#fff',
  ...theme.typography.body2,
  padding: theme.spacing(1),
  textAlign: 'center',
  color: theme.palette.text.secondary,
}));

const data = [
  { label: 'Jan', real: 21, predict: 21 },
  { label: 'Feb', real: 35, predict: 35 },
  { label: 'Mar', real: 75, predict: 57 },
  { label: 'Apr', real: 51, predict: 55 },
  { label: 'May', real: 41, predict: 63 },
  { label: 'Jun', real: 47, predict: 71 }
];

export default function Homefarmer() {
  return (
    <div>
      <h2 className="textshadow">Overview</h2>
      <Grid container spacing={3}>
        <Grid item xs>
        <Item style={{ backgroundColor: 'rgb(209, 233, 252)' }}>
        <BsBucketFill size={30} />
        <div style={{ fontSize: '30px', fontWeight: 'bold' }}>100K</div>
        <div>All milk</div>
        </Item>
        </Grid>
        <Grid item xs>
          <Item  style={{ backgroundColor: 'rgb(208, 242, 255)' }}><GiCow size={30} /><div style={{fontSize: '30px', fontWeight: 'bold'}}>100K</div><div>Milk/day</div></Item>
        </Grid>
        <Grid item xs>
          <Item style={{ backgroundColor: 'rgb(255, 247, 205)' }}><LuMilk size={30} /><div style={{fontSize: '30px', fontWeight: 'bold'}}>100K</div><div>Total Cow</div></Item>
        </Grid>
      </Grid>
      <Graphfarmer/>
    </div>
  );
}
